INSERT INTO `testimoni` (`id`, `nama`, `jabatan`, `testimoni`, `foto`, `urutan`, `created_at`, `updated_at`) VALUES
(1, 'Enggartiasto Lukita', 'Minister of Trade 2016 - 2019 - Host Partner ', '\"this event is organized smartly because it is not easy to make a 5-day event involving many parties, congratulations to the organizer, Debindo, I hope this event can be used as an example \"', 'testimoni-1.png', NULL, NULL, NULL),
(3, 'Arlinda Imbang Jaya ', 'Ex-DGNED - Host Partner', 'I see Debindo which holds this TEI 2018 has a better result than in 2017. Some obstacles have been successfully overcome. The position of zoning is excellent, the constructions are made to be more eye-catchy this year.', 'WhatsApp-Image-2019-09-17-at-23_17_49.jpg', NULL, NULL, NULL),
(4, 'Rosan P Roeslani', 'Chief of Indonesia Chamber of Commerce and Industry  2015-2021 - KADIN', 'this event is organized smartly because it is not easy to make a 5-day event involving many parties, congratulations to the organizer, Debindo, I hope this event can be used as an example ', 'Rosan-P-Roeslani.png', NULL, NULL, NULL),
(5, 'Djauhari Oratmangun', 'Ambassador of The Republic of Indonesia to the People\'s Republic of China and Mongolia', 'Debindo as the organizer has done its best, there has been tremendous progress from the previous TEI. I am very proud to be present at this year\'s event which has been well implemented, carried out in a professional manner, the transactions that have take', 'Djauhari_Oratmangun.jpg', NULL, NULL, NULL),
(6, 'Vinci ', 'Exhibition\'s Visitor', 'The organizer, Debindo, is very amazing. I honestly see that the organizer here is good, the exhibition staffs are professional and very supportive with the exhibitor. I am very happy.', 'vinci.jpg', NULL, NULL, NULL),
(7, 'Luz Perez Garcia', 'Exhibiton\'s Visitor', 'I\'m impressed about the quality of the well organize exhibition, quantity of attendees, the big range of sector sets that are today\'s exhibitions and the possibility of a very productive meeting & agreements with producers of import & exports of Indonesia', 'Screenshot_2024-01-24_154116.png', NULL, NULL, NULL),
(8, 'Handito Joewono', 'Exhibitor', 'The quality of the organization of the 38th Trade Expo Indonesia is excellent and beyond everything. It\'s clearly manage by expertise and professional committees and we really appreciated it.', 'Screenshot_2024-01-24_155200.png', NULL, NULL, NULL),
(9, 'Didi Sumedi', 'DGNED - Host Partner', 'The 38th Trade Expo Indonesia is successful running and well manage, it\'s shown by the improvement in any kind of sectors compared to previous years, both in terms of exhibitors, and the number of visitors. The offline visitors to the Trade Expo Indonesia', 'Screenshot_2024-01-24_155834.png', NULL, NULL, NULL),
(10, 'Jerry Sambuaga', 'Vice of Minister, Ministry of Trade', 'Congratulations on the successful organization of the 38th Trade Expo Indonesia. DEBINDO it\'s truly extraordinary, with significant result.', 'Screenshot_2024-01-24_155605.png', NULL, NULL, NULL),
(11, 'Loto Srinaita Ginting', 'Expert Staff for Finance and MSME Development', 'I really enjoy PaDi UMKM Expo with all the obstacles and opportunities. The event is very complete, under one event connect everything. Hopefully with the good quality of the management of this event will leads to bring significant impact to all SME\'s exh', 'Screenshot_2024-01-24_162839.png', NULL, NULL, NULL);
