-- (5, 'DEBINDO TRY MRT JAKARTA', '2019-03-12', '', 'Uji coba MRT (Mass Rapid Transportation) sudah dapat dinikmati oleh masyarakat DKI Jakarta sejak 12 Maret 2019 lalu. Selama masa uji coba, pengguna MRT dapat menikmati layanan MRT secara gratis. Euforia uji coba MRT ini juga turut dirasakan oleh seluruh karyawan PT Debindomulti Adhiswasti pada tanggal 18 Maret 2019 lalu.Dengan rute Lebak Bulus sampai Bundaran Hotel Indonesia, uji coba MRT terasa sangat menyenangkan. Tidak butuh waktu lama, perjalanan dari stasiun Lebak Bulus ke Stasiun Bundaran Hotel Indonesia hanya memakan waktu kurang lebih 30 menit. Perjalanan yang sangat cepat dibandingkan menggunakan kendaraan pribadi di lalu lintas DKI Jakarta.Selain untuk merasakan bagaimana sensasi menggunakan MRT, kegiatan ini juga diharapkan agar nantinya, karyawan Debindo dapat lebih aktif dalam menggunakan transportasi umum dan turut serta dalam mengurangi kemacetan di DKI Jakarta.', '1_(1).jpg', NULL, NULL),
-- (6, 'DEBINDO ANNIVERSARY', '2019-03-02', '', 'PT Debindomulti Adhiwasti telah memasuki usia ke 32 tahun, tepatnya pada tanggal 2 Maret 2019. Tahun ini, perayaan ulang tahun dilaksanakan di kantor pusat Debindo, yang berada di Gedung G9 Jl. KH. Abdullah Syafei No.9, Jakarta Selatan. Perayaan ini dihadiri oleh seluruh staff dan rekan Debindo.Dalam rangka merayakan Hari Ulang Tahun (HUT) ke-32, perusahaan yang bergerak di industri MICE ini mengadakan doa bersama demi berlanjutnya kesuksesan bisnis yang digelutinya. Selain itu untuk bersyukur kepada Tuhan YME yang selalu menyertai langkah Debindo hingga mencapai usia 32 tahun. Debindo juga berbagi kebahagiaan dengan makan bersama.Acara ini diawali oleh sambutan oleh para Board of Director dari PT Debindomulti Adhiwasti. Debindo berangkat dari bukan apa-apa, dan sekarang kita bersyukur sudah bisa ditahap saat ini, jelas Dwi Karsonno. Hal serupa juga dikatakan oleh Effi Setiabudi 32 tahun lalu, merintis bisnis bidang pameran itu sangat berat. Saya berharap kedepannya Debindo dapat konsisten dalam memberikan', '3.jpg', NULL, NULL),
-- (7, 'DEBINDO SPORTS DAY', '2019-02-22', '', 'Untuk menjaga kebugaran tubuh, olahraga merupakan aktivitas yang sangat penting untuk dilakukan. Terutama bagi pekerja di Jakarta yang sulit untuk mendapatkan waktu untuk berolahraga. Kegiatan olahraga yang rutin dilaksanakan dapat memberi dampak positif Untuk menjaga kebugaran tubuh, olahraga merupakan aktivitas yang sangat penting untuk dilakukan. Terutama bagi pekerja di Jakarta yang sulit untuk mendapatkan waktu untuk berolahraga. Kegiatan olahraga yang rutin dilaksanakan dapat memberi dampak positif untuk produktivitas dalam bekerja.Hal ini membuat PT Debindomulti Adhiswasti rutin melaksanakan kegiatan olahraga setiap hari jumat yang disebut sports week. Selain untuk menjaga kesehatan dan kebugaran tubuh, kegiatan olahraga ini juga penting untuk menambah kekompakan serta menunjang kerja sama yang lebih baik. Adapun manfaat lainnya adalah untuk meningkatkan energi dan membuat mood selalu positif.Futsal dan bulutangkis merupakan kegiatan olahraga tim yang sering dilakukan saat sport week berlangsung. PT. Debindomulti Adhiswasti yakin bahwa olahraga tim dapat memberikan dampak positif dalam menunjang produktivitas kerja, menunjang komunikasi antar pegawai yang lebih baik dan melatih fokus.', '1.jpg', NULL, NULL),
-- (8, 'Mengasah Kemampuan Menulis Karyawan PT. Debindomulti Adhiswasti', '2019-02-06', '', 'Penyampaian pesan, informasi dan komunikasi adalah bagian penting dalam industri bisnis. Baik dalam pekerjaan sehari-hari maupun dalam kegiatan perusahaan saat mempromosikan jasa dan produknya. Sayangya, banyak professional di bidang bisnis belum mengerti bagaimana cara penyampaian pesan dengan baik dan benar.Jakarta, 6 Februari 2019 - Penyampaian pesan, informasi dan komunikasi adalah bagian penting dalam industri bisnis. Baik dalam pekerjaan sehari-hari maupun dalam kegiatan perusahaan saat mempromosikan jasa dan produknya. Sayangya, banyak professional di bidang bisnis belum mengerti bagaimana cara penyampaian pesan dengan baik dan benar.\nBertempat di Ruang Pertemuan Gedung Debindo, workshop ini berlangsung dengan serius namun santai. Diawali dengan pemaparan dari Irwan Setiawan, pemimpin redaksi JawaPosTV. Ia memaparkan seluk beluk penulisan jurnalistik. Lalu dilanjutkan dengan Rully Kesuma, fotografer senior majalah Tempo, yang menjelaskan tentang fotografi jurnalistik. Dari acara tersebut, terlihat ant', '11.jpg', NULL, NULL),
-- (10, 'Debindo Network Outing Together Towards Tomorrow', '2018-12-21', '', 'To strengthen the bonds between all of Debindo branches, Debindo held an outing on 19th to 20th December at Panjang Jiwo Resort. This activity was intended to create a positive company culture that truly understands the employees both physical and mental needs.The theme of Debindo outing is Together Towards Tomorrow in which we share the same passion, the same curiosity and same goals as Debindo Network team. We look to continue working with all the branches to maximize opportunities and the collaborative benefits that come from working together as a group. Debindo also focuses on the significance of uniting as a group or community to successfully develop in defiance of global uncertainties.Furthermore, Debindo also conducted a yearly meeting. At the meeting, every branch updated their progress, shared their upcoming projects, exchange ideas and discuss objectives. This meeting is intended to reach a common agreement and create a feeling of continuity and solidarity in a bodys working.\n\nDebindo hopes th', '1_(1)4.jpg', NULL, NULL),
-- (11, 'Debindo Brainstorming Activity', '2018-12-12', '', 'In the age of new media, where the driving source of social evolution is technology, an established business needs to continue to grow their business by generating new ideas. Ideation is a key commodity in business.  Therefore, on 10th December 2018, Debindomulti Adhiswasti held a brainstorming activity as a key component of successful idea generation in the business.\n\nThe management has put employees into some groups. The group contains employees from a different department in the company. Debindo believes different skill sets and experiences will give a great mix of new perspectives and contextual knowledge which help the group to create original and doable ideas.\n\nEmployees are encouraged to let their imaginations grow by using a wishing technique. They were asked to come up with wildest and extreme ideas to create new projects. After that, focusing on a selection of project wishes, consider and discuss the ideas in detail, with the aim of triggering new but more realistic concepts to pursue. They were', '41.jpg', NULL, NULL),
-- (12, 'Pameran Indocraft ke-15 Resmi Dibuka', '2018-11-21', '', 'Acara tahunan batik dan craft, Pameran Indocraft, kembali dilaksanakan untuk ke-15 kalinya. Pameran ini merupakan pameran rutin yang diselenggarakan oleh PT. Debindomulti Adhiswasti. Indocraft 2018 resmi dibuka oleh Deputi Bidang Pengembangan Kementerian ', '1_(1)6.jpg', NULL, NULL),
-- (13, 'First Day of TEI 2018 Recorded 44 Trade Contracts & Investment', '2018-11-24', '', 'On the first day, TEI 2018 was successfully recorded the signing of 44 trade contracts and investment, consisting of trade transactions of USD 513.97 million and investments of USD 4.68. That became a new record. For the investment sector, carried out by ', '13.jpg', NULL, NULL),
-- (14, 'SOUTHEAST ASIAS LEADING SUPPLY CHAIN EXHIBITION AND CONFERENCE', '2018-05-06', '', 'CTCT was held on the 2nd to 6th May 2018 at the Indonesia Convention Exhibition, BSD Tangerang. This exhibition consists of CeMAT Southeast Asia | IndoTransLog | IndoColdChain | IndoTruck 2018 (CTCT) which is the new name and continued from the rst editi', 'CTCT11.jpg', NULL, NULL),
-- (15, 'PENGUMUMAN RESMI PEMENANG GRAND PRIZE MANDIRI PROPERTY EXPO 2018', '2018-05-13', '', 'PT Debindomulti Adhiswasti selaku penyelenggara Mandiri Property Expo 2018 di Jakarta Convention Center 5-13 Mei 2018, dengan bangga menyampaikan kabar gembira bahwa Grand Prize berupa 1 Unit Rumah telah dimenangkan oleh:\nSdri. \n\nVEGA THERESIA Dengan N', 'UNDIAN1.jpg', NULL, NULL),
-- (16, 'KUNJUNGI MANDIRI PROPERTY EXPO 2018 DAN REBUT GRAND PRIZE 1 UNIT RUMAH', '2018-05-05', '', 'PT Bank Mandiri Tbk. (Persero) menghadirkan solusi pemilikan properti hunian dan niaga melalui penyelanggaraan Mandiri Property Expo 2018 di Jakarta Convention Center tanggal 5-13 Mei 2018. bekerjasama dengan PT Debindomulti Adhiswasti dan didukung oleh D', 'MANDIRIPROPERYEXPO11.jpg', NULL, NULL),
-- (17, 'PRESIDEN BUKA PAMERAN TRADE EXPO INDONESIA 2017', '2017-11-11', '', 'Presiden Joko Widodo (Jokowi) membuka pameran dagang terbesar di Indonesia, Trade Expo Indonesia (TEI) ke-32 di Indonesia Convention Exhibition Bumi Serpong Damai (ICE BSD), Tangerang Selatan, Banten. Pameran ini berlangsung pada 11-15 Oktober 2017.\r\n\r\nGr', 'TEI11.jpg', NULL, NULL),
-- (18, 'BERBURU RUMAH MURAH DI REI EXPO 2017', '2017-04-15', '', 'Real Estate Indonesia Expo (REI Expo) 2017 berlangsung sejak hari Sabtu (15/4/2017) hingga Minggu (23/4/2017). Pameran ini digelar di JCC Senayan mulai pukul 10.00 WIB hingga pukul 21.00 WIB. Sejumlah pengembang properti tengah berkumpul untuk memeriahkan', 'REI1.jpg', NULL, NULL),
-- (22, 'Debindo\'s 37th Anniversary', '2024-04-07', 'Debindomulti Adhiswasti', '<div>&nbsp;</div><div>PT Debindomulti Adhiswasti merayakan ulang tahunnya yang ke-37 dengan gemilang di The Westin pada Kamis (07/04/2024). Kemeriahan acara ditandai dengan beragam kegiatan games yang diikuti dengan antusias oleh seluruh karyawan, yang turut mempererat ikatan di dalam perusahaan. Kehadiran komisaris seperti Bapak Dwi Karsono, Bapak Effi Setiabudi, Direktur Budiarto Linggowijono, dan Direktur Vibiadhi Swasti Pradana memberikan sentuhan istimewa pada perayaan yang bersejarah ini.&nbsp;</div><div>Sebagai pelopor dan penggerak utama dalam industri event, PT Debindomulti Adhiswasti terus memimpin dengan terobosan inovatif dan kekreatifitasan yang tak tertandingi. Semoga momen ulang tahun ini menjadi awal yang menginspirasi bagi perjalanan menuju prestasi dan kesuksesan yang tak terhingga di masa depan.</div><div><br>&nbsp;</div>', '1715576215_DSCF4658 (1).JPG', '2024-05-12 21:56:55', '2024-05-12 21:56:55'),
-- (23, 'PT Debindomulti Adhiswasti Outing to Bali', '2024-02-01', 'Debindomulti Adhiswasti', '<div>PT Debindomulti Adhiswasti menyelenggarakan acara Team Building yang menyenangkan di pulau Bali selama 4 hari. Kami berhasil menciptakan momen-momen tak terlupakan yang tidak hanya menghibur, tetapi juga menguatkan ikatan tim yang sudah kuat di dalam perusahaan.</div><div>Kami berterima kasih kepada semua yang telah berkontribusi dalam kesuksesan acara ini dan kami berharap dapat terus melangkah maju bersama-sama, menghadirkan inovasi dan prestasi yang gemilang bagi PT Debindomulti Adhiswasti.</div><div><br><br></div>', '1715576365_DBN_4344.jpg', '2024-05-12 21:59:25', '2024-05-12 21:59:25'),
-- (26, 'The 38th Trade Expo Indonesia', '2023-10-23', 'Debindomulti Adhiswasti', '<div>PT Debindomulti Adhiswasti sebagai Co-Organizer Berhasil Menggelar Trade Expo Indonesia 2023 yang diselenggarakan oleh Kementerian Perdagangan.</div><div><br></div><div>PT Debindomulti Adhiswasti dengan bangga mengumumkan kesuksesan penyelenggaraan Trade Expo Indonesia (TEI) 2023, yang diselenggarakan bekerja sama dengan Kementerian Perdagangan dan Kamar Dagang dan Industri Indonesia (Kadin). Sebagai pameran dagang B2B terbesar di Indonesia dengan skala internasional, TEI berhasil memperlihatkan potensi perdagangan global Indonesia.</div><div><br></div><div>Edisi ke-38 TEI, dengan tema Sustainable Trade for Global Economic Resilience, menampilkan produk dan jasa premium dari tujuh sektor. Dengan jumlah pembeli lebih dari 6.000 dari 150 negara, acara ini menjadi platform penting untuk memperkuat kerjasama ekonomi dan mempromosikan lanskap perdagangan Indonesia yang dinamis.</div><div><br></div><div>Berlangsung dari tanggal 18 hingga 22 Oktober 2023, di Indonesia Convention Exhibition (ICE) di BSD City, Tangerang Selatan, TEI menawarkan platform pameran fisik dan online. Pameran online dapat diakses 24/7 mulai dari tanggal 18 Oktober hingga 22 Desember 2023, melalui www.tradexpoindonesia.com, sehingga memastikan aksesibilitas global dan peluang jaringan yang luas di luar batas fisik acara.</div><div><br></div><div>Selain pameran, Trade Expo Indonesia Hybrid Edition menampilkan serangkaian kegiatan paralel, termasuk Internasional Seminar, Business Matching, dan Business Counseling. Inisiatif-inisiatif ini memberikan dukungan komprehensif dan peluang jaringan yang luas, memfasilitasi pertukaran yang bermakna dan mendorong pertumbuhan bisnis secara global.</div>', '1715578072_ATIH5316.jpg', '2024-05-12 22:27:52', '2024-05-12 22:27:52'),
-- (27, 'Launching Trade Expo Indonesia 2024', '2024-05-31', NULL, '<div>Menteri Perdagangan, Zulkifli Hasan bersama Wakil Menteri Perdagangan, Jerry Sambuaga; Plt. Sekretariat Jenderal, Suhanto; Direktur Jenderal Pengembangan Ekspor Nasional, Didi Sumedi; Senior Vice President Government Solution, Aland Rinny Paiti; Direktur Utama PT Debindomulti Adhiswasti,&nbsp; Vibiadhi Swasti Pradana; dan Perwakilan Kadin, Budiarto Linggowijono meluncurkan Trade Expo Indonesia ke-39 yang mengangkat tema \"Build Strong Connection with the Best of Indonesia\" di Kantor Kementerian Perdagangan, Jakarta, Jumat (31 Mei). &nbsp;<br><br></div><div>Trade Expo Indonesia adalah sebuah platform yang memungkinkan entitas bisnis dari sektor domestik dan internasional untuk terhubung. Acara ini telah diadakan selama 39 tahun dan berfungsi sebagai wadah bagi para pembeli internasional untuk berinteraksi dengan pelaku bisnis nasional.<br><br></div>', '1719464322_PHOTO-2024-05-31-14-25-26 (2).jpg', '2024-06-26 21:58:42', '2024-06-26 21:58:42');

